/**---------------------------------------------------------------------------/

 * ! constants/string.ts
 * * 변경 안되는 메세지

/**--------------------------------------------------------------------------*/
export const MAIN_MESSAGE_TITLE = "안녕하세요!";
export const MAIN_TEXTS_ANIMATION_ARR = [
  "기술 변화에 빠르게 적응하고,",
  "사용자 중심의 경험을 제공하며,",
  "지속적으로 성장하는",
];
export const MAIN_MESSAGE_TEXT = "개발자 강가영입니다.";
export const BACKGROUND_SECTION_MESSAGE_CAPTION = "Background";
export const BACKGROUND_SECTION_MESSAGE_TITLE =
  "웹 디자인부터 퍼블리싱, 프론트엔드까지\n다양한 분야를 아우르는 전문가입니다.";
export const BACKGROUND_SECTION_MESSAGE_TEXT =
  "창의적이고 세련된 디자인을 통해 사용자 경험을 최우선으로 고려한 직관적인 인터페이스를 제공합니다.\n 또한, 효율적인 코드 작성과 최신 기술을 활용해 웹 사이트 성능을 최적화하며, 모든 과정에서 꼼꼼함과 완성도를 중요시합니다.\n이러한 역량을 바탕으로 고객의 요구에 맞춘 맞춤형 웹 솔루션을 제공하고 있습니다.";
export const DEVELOPMENT_TITLE = "다양한 디바이스.";
export const DEVELOPMENT_TEXT =
  "최적화된 화면을 제공하는 웹사이트를 개발합니다.";
export const TECHNOLOGY_TITLE = "당신의 가능성을 확장하는 기술.";
export const TECHNOLOGY_TEXT = "저의 스킬을 소개합니다.";
export const TECHNOLOGY_CARD_REACT_TITLE = "React.js";
export const TECHNOLOGY_CARD_NEXT_TITLE = "Next.js";
export const TECHNOLOGY_CARD_TYPESCRIPT_TITLE = "Typescript";
export const TECHNOLOGY_CARD_HTML_TITLE = "HTML5";
export const TECHNOLOGY_CARD_CSS_TITLE = "CSS3";
export const TECHNOLOGY_CARD_JAVASCRIPT_TITLE = "JavaScript";
export const FOOTER_COPYRIGHT = "Copyright © GayoungKang. All rights reserved.";
/**---------------------------------------------------------------------------/

 * ! constants/string.ts
 * * URL

/**--------------------------------------------------------------------------*/
export const GIT_HUB_URL = "https://github.com/gayoungkang";
export const BLOG_URL = "https://justgy.tistory.com/";
/**---------------------------------------------------------------------------/

 * ! constants/string.ts
 * * 에러 메세지

/**--------------------------------------------------------------------------*/
export const ERROR_INVALID_HEX_COLOR =
  "잘못된 16진수 색상 코드가 제공되었습니다.";
